import { UPDATE_SLOT } from "../constants";

/**
 * to select plan with plan number
 * @param {*} plan
 * @param {*} planNumber
 */
export const updateSlot = (slot) => {
  return {
    type: UPDATE_SLOT,
    payload: slot,
  };
};
